import React from 'react'
import './About.css'
import 'aos/dist/aos.css'
import AOS from 'aos'
AOS.init();
AOS.init({
    // offset: 200,
    duration: 1000,
    easing: 'ease-out',
    delay: 100,
  });

export default function About() {

    
    return (
        <div  data-aos="about-animation" >
            <div className="About">
                <p> About Me 
                    <div class="para1-style">
                        
                    </div>
                </p>
                <p className="about-description">
                    
                        Working as a full stack web developer for about 1 year. I have    created several websites specially for school , an organization, an online store.
                    
                    <br/><br/>
                        I use reactJS for frontend with HTML, CSS and JavaScript, NodeJS, expressJS for backend, Mongodb for database.
                <br/><br/>
                        Have the quality of Hard working, self-motivated and quick learner.
                </p>
            </div>
        </div>
    )
}
